import React from 'react';
import './App.css';
import CurrencyCard from './CurrencyCard';

function App() {
  return (
    <div className="App">
      <header className="App-header" style={{justifyContent: "flex-start"}}>
      <h4 className="headersStyle">Gemini Exchange</h4>
        <div className="exchange">
          <div className="currencyType">
            <CurrencyCard type="BTC" url="http://localhost:8080/getgemini?currencyType=BTC"></CurrencyCard>
          </div>
          <div className="currencyType">
            <CurrencyCard type="ETH" url="http://localhost:8080/getgemini?currencyType=ETH"></CurrencyCard>
          </div>
      </div>
      <h4 className="headersStyle">Coinbase Exchange</h4>
        <div className="exchange">
          <div className="currencyType">
            <CurrencyCard type="BTC" url="http://localhost:8080/getCoinbase?currencyType=BTC"></CurrencyCard>
          </div>
          <div className="currencyType">
            <CurrencyCard type="ETH"></CurrencyCard>
          </div>
      </div>
      </header>
    </div>
  );
}

export default App;
